import React, { Component } from 'react'
import Button from 'components/Button'
import { push } from 'connected-react-router'
import { bindActionCreators } from 'redux'
import { connect } from 'react-redux'
import './style.scss'

class QuizMobile extends Component {
	render(){
		return(
			<div className="quizMobileContainer">
				<Button text="testing" />
			</div>
		)
	}
}


const mapStateToProps = state => ({
	room: state.generalPlayer.room,
	players: state.generalHost.players,
	router: state.router,
	quizPlayers: state.quizHost.players,
	currentQuestion: state.quizHost.currentQuestion,
	quizState: state.quizHost.quizState,

})

const mapDispatchToProps = dispatch => bindActionCreators({
  push: (path) => push(path),
  setupGame,
  showAnswer,
  showQuestionHost,
  showScores,
}, dispatch)

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(QuizHost)
